import React, { useState } from "react";
import './Navbar.css';

  import hart from '../../assets/hart.png'
  import cart from '../../assets/cart.png'
  import logo from '../../assets/logo.png'
  import menu from '../../assets/menu.png'  
  import home from '../../assets/home.png'
  import {useNavigate} from 'react-router-dom'
  import {axios} from 'axios'


const Navbar = () => {

  const [category, setCategory] = useState([])

  const fetchCategoryListData = async ()=> {
    try {
      const response = await axios.get('https://dummyjson.com/products/categories')
      setCategory(response.data)
    } catch (error) {
      console.error('errrrrrr', error)
    }
  }

  const dhars = useNavigate();

  const hartt = () => {
    dhars('/Hart') 
  }

  const cartt = () => {
    dhars('/Cart')
  }

  
  return (
    <>
      <div className="header">
        <div className="blogo">
        <img style={{width:130,height:70,marginTop:-30,}} src={logo} alt="ss" />
         </div>
        <div className="search">
           <form>
           <select>
              <option>All</option>
              <option>Home and Garden</option>
              <option>Shoes</option>
              <option>Watches</option>
              <option>Electronics components</option>
            </select>
            <input type="text" placeholder="Search for products"></input>
            <button>Go</button><br></br><br></br>
              <a href="/#">Gift Shop</a>&nbsp;&nbsp;
              <a href="/#">Become a seller</a>&nbsp;&nbsp;
              <a href="/#">Special offers</a>&nbsp;&nbsp;
              <a href="/#">Buyer protection</a>
          </form>
        </div> 
        
        <div className="icons">
         
      <img  style={{width:50,height:50}} src={hart} alt="h" onClick={hartt} />&nbsp;&nbsp;&nbsp;&nbsp;
   <img  style={{width:50,height:50}} src={cart} alt="l" onClick={cartt} /> 
        </div>
</div>

{/* <div className="categoriess">
<img style={{width:30,height:20,marginTop:-30,paddingLeft:100,paddingTop:100}} src={menu} alt="ss" />&nbsp;
<span style={{paddingTop:68}}>Categories </span>
</div> */}
<div className="cat">
<div style={{flexDirection:"row",alignItems:"center",display:'flex',marginTop:60,marginLeft:60}}>
<img style={{width:30,height:30,marginLeft:10}} src={menu} alt="ss"/>&nbsp;&nbsp;
 <b><span>Categories</span></b>
 </div>
 {
  category.map
 }
 </div>
    </>
  );
};

export default Navbar;
